import "./header.css"; // Add the CSS file for styles

const Header = () => {
  const [isMobileMenuOpen, setMobileMenuOpen] = useState(false);
  const [activeTab, setActiveTab] = useState("Home");

  const handleTabClick = (tab) => {
    setActiveTab(tab);
    setMobileMenuOpen(false); // Close menu on mobile when a tab is clicked
  };

  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <img src="path/to/logo.png" alt="Order Logo" />
      </div>
      <ul className={`navbar-links ${isMobileMenuOpen ? "active" : ""}`}>
        <li className={`nav-item ${activeTab === "Home" ? "active" : ""}`}>
          <a href="#home" onClick={() => handleTabClick("Home")} className="nav-link">
            Home
          </a>
        </li>
        <li className={`nav-item ${activeTab === "Menu" ? "active" : ""}`}>
          <a href="#menu" onClick={() => handleTabClick("Menu")} className="nav-link">
            Menu
          </a>
        </li>
        <li className={`nav-item ${activeTab === "Contact" ? "active" : ""}`}>
          <a href="#contact" onClick={() => handleTabClick("Contact")} className="nav-link">
            Contact
